"use strict";new Vue({el:"#app",data:{formData:{messageNumber:0,address:"",account:"",passKey:""}},mounted:function(){var a=this;axios.post("/phoneInfo/data_get_data").then(function(s){if(s.data.status){var e=JSON.parse(s.data.message);a.formData.messageNumber=e.messageNumber,a.formData.address=e.address,a.formData.account=e.account,a.formData.passKey=e.passKey}})},methods:{save:function(){var a=this;axios.post("/phoneInfo/data_save").then(function(s){s.data.status?a.$message({type:"success",message:s.data.message}):a.$message({type:"error",message:s.data.message})}).catch(function(s){a.$message({type:"error",message:s})})}}});